import React from 'react';
i
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHtml5, faWordpressSimple, faAngular, faJs } from '@fortawesome/free-brands-svg-icons';

const TeamSection = () => {
    return (
        <section className="section-team">
            <div className="container">
                {/* Start Header Section */}
                <div className="row justify-content-center text-center">
                    <div className="col-md-8 col-lg-6">
                        <div className="header-section">
                            <h3 className="small-title">Our Experts</h3>
                            <h2 className="title">Let's meet with our team members</h2>
                        </div>
                    </div>
                </div>
                {/* / End Header Section */}
                <div className="row">
                    {/* Start Single Person */}
                    <TeamMember
                        imgSrc="https://i.ibb.co/G2CBWvb/person1.jpg"
                        name="John Doe"
                        speciality="Web Developer"
                        icon={<FontAwesomeIcon icon={faHtml5} />}
                    />
                    {/* / End Single Person */}
                    {/* Start Single Person */}
                    <TeamMember
                        imgSrc="https://i.ibb.co/nbpNr4r/person2.jpg"
                        name="Robert Smith"
                        speciality="WordPress Developer"
                        icon={<FontAwesomeIcon icon={faWordpressSimple} />}
                    />
                    {/* / End Single Person */}
                    {/* Start Single Person */}
                    <TeamMember
                        imgSrc="https://i.ibb.co/25zdRMr/person3.jpg"
                        name="John Doe"
                        speciality="Angular Developer"
                        icon={<FontAwesomeIcon icon={faAngular} />}
                    />
                    {/* / End Single Person */}
                    {/* Start Single Person */}
                    <TeamMember
                        imgSrc="https://i.ibb.co/w0ynr2Q/person4.jpg"
                        name="John Smith"
                        speciality="Javascript Developer"
                        icon={<FontAwesomeIcon icon={faJs} />}
                    />
                    {/* / End Single Person */}
                </div>
            </div>
        </section>
    );
};

const TeamMember = ({ imgSrc, name, speciality, icon }) => {
    return (
        <div className="col-sm-6 col-lg-4 col-xl-3">
            <div className="single-person">
                <div className="person-image">
                    <img src={imgSrc} alt={name} />
                    <span className="icon">{icon}</span>
                </div>
                <div className="person-info">
                    <h3 className="full-name">{name}</h3>
                    <span className="speciality">{speciality}</span>
                </div>
            </div>
        </div>
    );
};

export default TeamSection;
